@Override
public void getDistanceBounds(final Bounds bounds, final DistanceStyle distanceStyle, final double distanceValue) {
  if (distanceValue == Double.MAX_VALUE) {
    getBounds(bounds);
    return;
  }
  distanceBounds(bounds, distanceStyle, distanceValue);
}

